using AvxBlas;
using Microsoft.VisualStudio.TestTools.UnitTesting;
using System;
using System.Linq;

namespace AvxBlasTest.Connection3DTest {
    [TestClass]
    public class BackwardFilterPadNoneTest {
        [TestMethod]
        public void SBackwardFilterPadNoneTest() {
            float max_err = 0;

            foreach (uint n in new int[] { 1, 2 }) {
                foreach ((uint iw, uint ih, uint id) in new (uint, uint, uint)[] {
                    (1, 1, 1), (1, 1, 4), (1, 4, 1), (4, 1, 1), (5, 2, 8), (12, 16, 15) }) {

                    foreach ((uint kw, uint kh, uint kd) in new (uint, uint, uint)[] {
                        (1, 1, 1), (1, 1, 3), (1, 3, 1), (3, 1, 1), (3, 3, 3), (3, 1, 5), (3, 5, 3), (5, 5, 5) }) {

                        if (iw < kw || ih < kh || id < kd) {
                            continue;
                        }
                        uint ow = iw - kw + 1, oh = ih - kh + 1, od = id - kd + 1;

                        foreach ((uint ic, uint oc) in new (uint, uint)[] { (1, 1), (2, 3), (3, 2), (4, 5), (5, 4), (8, 10), (10, 8),
                                                                            (7, 16), (16, 7), (9, 24), (24, 9), (31, 32), (32, 31), (43, 48), (48, 43), (15, 64), (64, 15) }) {

                            float[] xval = (new float[iw * ih * id * ic * n]).Select((_, idx) => idx * 1e-3f).ToArray();
                            float[] gyval = (new float[ow * oh * od * oc * n]).Select((_, idx) => idx * 1e-3f).Reverse().ToArray();

                            Map3D x = new((int)ic, (int)iw, (int)ih, (int)id, (int)n, xval);
                            Map3D gy = new((int)oc, (int)ow, (int)oh, (int)od, (int)n, gyval);

                            Filter3D gw = Reference(x, gy, (int)kw, (int)kh, (int)kd);

                            Array<float> x_tensor = xval;
                            Array<float> gy_tensor = gyval;

                            Array<float> gw_tensor = new(ic * oc * kw * kh * kd, zeroset: false);

                            Convolution3D.BackwardFilter(n, ic, oc, iw, ih, id, kw, kh, kd, PadMode.None, x_tensor, gy_tensor, gw_tensor);

                            float[] gw_expect = gw.ToFloatArray();
                            float[] gw_actual = gw_tensor;

                            CollectionAssert.AreEqual(xval, (float[])x_tensor);
                            CollectionAssert.AreEqual(gyval, (float[])gy_tensor);

                            AssertError.Tolerance(gw_expect, gw_actual, 1e-6f, 1e-4f, ref max_err, $"NG: {ic},{oc},{iw},{ih},{id},{kw},{kh},{kd},{n}");

                            Console.WriteLine($"OK: {ic},{oc},{iw},{ih},{id},{kw},{kh},{kd},{n}");
                        }
                    }
                }
            }

            Console.WriteLine($"maxerr:{max_err}");
        }

        public static Filter3D Reference(Map3D x, Map3D gy, int kw, int kh, int kd) {
            int inchannels = x.Channels, outchannels = gy.Channels, batch = x.Batch;
            int iw = x.Width, ow = gy.Width, ih = x.Height, oh = gy.Height, id = x.Depth, od = gy.Depth;

            if (ow != iw - kw + 1 || oh != ih - kh + 1 || od != id - kd + 1) {
                throw new ArgumentException("mismatch shape");
            }

            Filter3D w = new(inchannels, kw, kh, kd, outchannels);

            for (int th = 0; th < batch; th++) {
                for (int kz = 0; kz < kd; kz++) {
                    for (int ky = 0; ky < kh; ky++) {
                        for (int kx = 0; kx < kw; kx++) {
                            for (int iz = kz, oz = 0; oz < od; iz++, oz++) {
                                for (int iy = ky, oy = 0; oy < oh; iy++, oy++) {
                                    for (int ix = kx, ox = 0; ox < ow; ix++, ox++) {
                                        for (int inch, outch = 0; outch < outchannels; outch++) {
                                            for (inch = 0; inch < inchannels; inch++) {
                                                w[inch, kx, ky, kz, outch] += x[inch, ix, iy, iz, th] * gy[outch, ox, oy, oz, th];
                                            }
                                        }
                                    }
                                }
                            }
                        }
                    }
                }
            }

            return w;
        }

